import React from 'react';
import './header.styles.scss';
import { SearchBox } from '../search/search.component';
import Image from '../../assets/logo.png';
const Header = () => (
   <header>
       <div className="left">
           <img src={Image}></img>
       </div>
       <div className="right"></div>

   </header>
);

export default Header;
